import './App.css';
import Login from './Components/Login';
import {BrowserRouter, Routes, Route} from 'react-router-dom'
import { MyCompo } from './Components/MyCompo';

function App() {
  return (
    <div className="App">
      <BrowserRouter>

      <Routes>

        <Route path='/' element={<MyCompo/>}></Route>
        <Route path='/login' element={<Login/>}>
        </Route>

      </Routes>



      </BrowserRouter>
      <Login/>
    </div>
  );
}

export default App;
